INSERT INTO explorer_query VALUES(2,'SADiCARNOT10 Depositos y Retiros en Periodo',replace(replace('SELECT nombre,\r\n       cuenta,\r\n       strftime(''%m-%Y'', fecha) as mes,\r\n       --date_format(fecha,''%m-%Y'') AS mes,\r\n       MIN(sadi_movimiento.FECHA) AS fec_ini,\r\n       MAX(sadi_movimiento.FECHA) AS fec_fin,\r\n       round(SUM(sadi_movimiento.deposito),2) AS depositos,\r\n       round(SUM(sadi_movimiento.retiro),2) AS retiros,\r\n       round(sum(deposito) - sum(retiro),2) AS diferencia\r\nFROM sadi_movimiento,\r\n     sadi_cuenta_banco,\r\n     periodo_procesos,\r\n     condominio\r\nWHERE sadi_cuenta_banco.id = sadi_movimiento.cuenta_banco_id\r\n  AND FECHA >= periodo_procesos.fecha_inicial\r\n  AND FECHA <= periodo_procesos.fecha_final\r\n  AND sadi_cuenta_banco.condominio_id = periodo_procesos.condominio_id\r\n  AND sadi_cuenta_banco.condominio_id = condominio.id\r\nGROUP BY 1,\r\n         2,\r\n         3\r\nORDER by 2,4,3','\r',char(13)),'\n',char(10)),'Depositos y retiros por periodo con corte mensual','2019-04-28 18:23:28.196430','2019-05-02 23:24:00.037611',1,0,'default');
INSERT INTO explorer_query VALUES(3,'SADICARNOT10 Saldo Total',replace(replace('SELECT nombre,\r\n       printf("%.2f",round(periodo_procesos.saldo_inicial,2)) as saldo_inicial, \r\n       printf("%.2f",round(SUM(sadi_movimiento.deposito),2)) AS depositos,\r\n       printf("%.2f",round(SUM(sadi_movimiento.retiro),2)) AS retiros,\r\n       printf("%.2f",round(periodo_procesos.saldo_inicial,2) + round(sum(deposito),2) - round(sum(retiro),2)) AS saldo_final\r\nFROM sadi_movimiento,\r\n     periodo_procesos,\r\n     condominio,\r\n     sadi_cuenta_banco\r\nWHERE sadi_cuenta_banco.id = sadi_movimiento.cuenta_banco_id\r\n  AND sadi_cuenta_banco.condominio_id = periodo_procesos.condominio_id\r\n  AND sadi_cuenta_banco.condominio_id = condominio.id\r\nGROUP BY 1\r\n         \r\n    ','\r',char(13)),'\n',char(10)),'','2019-04-28 19:08:55.944996','2019-04-29 17:47:10.329323',1,0,'default');
INSERT INTO explorer_query VALUES(4,'SADICARNOT10 Saldo inicial por Cuenta',replace(replace('SELECT nombre, cuenta, saldo as saldo_inicial, min(fecha) as fecha_inicial, max(fecha) as fecha_final\r\nFROM sadi_movimiento,\r\n     sadi_cuenta_banco,\r\n     periodo_procesos,\r\n     condominio\r\nWHERE sadi_cuenta_banco.id = sadi_movimiento.cuenta_banco_id\r\n  AND FECHA >= periodo_procesos.fecha_inicial\r\n  AND FECHA <= periodo_procesos.fecha_final\r\n  AND sadi_cuenta_banco.condominio_id = periodo_procesos.condominio_id\r\n  AND sadi_cuenta_banco.condominio_id = condominio.id\r\nGROUP BY 1,\r\n         2,\r\n         3\r\nORDER by 4,2\r\n','\r',char(13)),'\n',char(10)),'Saldo inicial por cuenta','2019-04-29 17:51:47.350166','2019-05-02 23:18:01.140868',1,0,'default');
INSERT INTO explorer_query VALUES(5,'SADICARNOT10 Ingresos y Egresos por Cuenta y Mes',replace(replace('SELECT *\r\nFROM ''sadi_acumulado_mes''\r\norder by fecha_inicial','\r',char(13)),'\n',char(10)),'Deposito y retiros de las cuentas bancarias','2019-04-30 01:36:41.748628','2019-04-30 01:52:40.641290',1,0,'default');
INSERT INTO explorer_query VALUES(6,'SADICARNOT10 Estado de cuenta por condominio',replace(replace('SELECT p.fecha_inicial AS fecha_inicial,\r\n       p.fecha_final AS fecha_final,\r\n       trim(depto) || '' '' || trim(propietario) AS Descripcion,\r\n       cargos,\r\n       pagos AS depositos,\r\n       d.saldo\r\nFROM condominio co,\r\n     sadi_condomino d,\r\n     periodo_procesos p\r\nWHERE p.condominio_id = co.id\r\n  AND co.nombre = ''SADICARNOT10''\r\n  AND d.depto = $$depto$$\r\nUNION\r\nSELECT m.fecha as fecha_inicial,\r\n       m.fecha as fecha_final,\r\n       trim(tm.descripcion) || '' '' || m.descripcion AS Descripcion,\r\n       haber AS cargo,\r\n       debe AS deposito,\r\n       m.saldo\r\nFROM cuenta_contable c,\r\n     condominio co,\r\n     sadi_condomino d,\r\n     sadi_asiento m,\r\n     periodo_procesos p,\r\n     tipo_movimiento tm\r\nWHERE m.condomino_id = d.id\r\n  AND m.fecha >= fecha_inicial\r\n  AND m.fecha <= fecha_final\r\n  AND p.condominio_id = co.id\r\n  AND co.nombre = ''SADICARNOT10''\r\n  AND d.depto = $$depto$$\r\n  AND m.cuenta_contable_id = c.id\r\n  AND m.tipo_movimiento_id = tm.id\r\nORDER BY 1','\r',char(13)),'\n',char(10)),'Estado de cuenta por condomino','2019-05-02 23:44:56.594622','2019-05-03 02:09:51.495102',1,0,'default');
