PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "banco" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "clave" varchar(3) NOT NULL, "descripcion" varchar(25) NULL);
CREATE TABLE IF NOT EXISTS "condominio" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(45) NOT NULL, "calle" varchar(45) NULL, "colonia" varchar(45) NULL, "delegacion" varchar(45) NULL, "ciudad" varchar(45) NULL, "estado" varchar(45) NULL, "cp" varchar(5) NULL, "regimen" varchar(45) NULL, "rfc" varchar(13) NULL, "fecha_constitucion" date NULL);
CREATE TABLE IF NOT EXISTS "proveedore" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "proveedor" varchar(60) NOT NULL, "domicilio" varchar(100) NULL, "telefono" varchar(30) NULL, "email" varchar(30) NULL, "rfc" varchar(13) NULL, "clabe" varchar(18) NULL);
CREATE TABLE IF NOT EXISTS "situacion" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "situacion" varchar(25) NOT NULL);
CREATE TABLE IF NOT EXISTS "tipo_documento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "descripcion" varchar(25) NOT NULL);
CREATE TABLE IF NOT EXISTS "tipo_movimiento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "descripcion" varchar(25) NOT NULL);
CREATE TABLE IF NOT EXISTS "cuenta_contable" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "num_cuenta" varchar(20) NOT NULL, "descripcion" varchar(100) NOT NULL, "clave_mayor" varchar(4) NOT NULL);
CREATE TABLE IF NOT EXISTS "sadi_documento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "folio" integer NOT NULL, "fecha_expedicion" date NOT NULL, "monto_total" decimal NULL, "notas" varchar(45) NULL, "situacion_id" integer NULL REFERENCES "situacion" ("id") DEFERRABLE INITIALLY DEFERRED, "tipo_documento_id" integer NULL REFERENCES "tipo_documento" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "sadi_estacionamiento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ubicacion" varchar(40) NULL);
CREATE TABLE IF NOT EXISTS "sadi_movimiento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fecha" date NULL, "descripcion" varchar(250) NULL, "retiro" decimal NULL, "deposito" decimal NULL, "condomino_id" integer NOT NULL REFERENCES "sadi_condomino" ("id") DEFERRABLE INITIALLY DEFERRED, "cuenta_banco_id" integer NOT NULL REFERENCES "sadi_cuenta_banco" ("id") DEFERRABLE INITIALLY DEFERRED, "documento_id" integer NOT NULL REFERENCES "sadi_documento" ("id") DEFERRABLE INITIALLY DEFERRED, "tipo_movimiento_id" integer NULL REFERENCES "tipo_movimiento" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "sadi_detalle_movimiento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "descripcion" varchar(250) NULL, "monto" decimal NULL, "cuenta_contable_id" integer NOT NULL REFERENCES "cuenta_contable" ("id") DEFERRABLE INITIALLY DEFERRED, "movimiento_id" integer NOT NULL REFERENCES "sadi_movimiento" ("id") DEFERRABLE INITIALLY DEFERRED, "proveedor_id" integer NOT NULL REFERENCES "proveedore" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "sadi_condomino_estacionamiento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "condomino_id" integer NOT NULL REFERENCES "sadi_condomino" ("id") DEFERRABLE INITIALLY DEFERRED, "estacionamiento_id" integer NOT NULL REFERENCES "sadi_estacionamiento" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "sadi_asiento" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fecha" date NULL, "fecha_vencimiento" date NULL, "descripcion" varchar(250) NULL, "debe" decimal NULL, "haber" decimal NULL, "saldo" decimal NULL, "a_favor_id" integer NOT NULL REFERENCES "proveedore" ("id") DEFERRABLE INITIALLY DEFERRED, "condomino_id" integer NOT NULL REFERENCES "sadi_condomino" ("id") DEFERRABLE INITIALLY DEFERRED, "cuenta_contable_id" integer NOT NULL REFERENCES "cuenta_contable" ("id") DEFERRABLE INITIALLY DEFERRED, "tipo_movimiento_id" integer NULL REFERENCES "tipo_movimiento" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "explorer_querylog" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sql" text NULL, "run_at" datetime NOT NULL, "query_id" integer NULL REFERENCES "explorer_query" ("id") DEFERRABLE INITIALLY DEFERRED, "run_by_user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "duration" real NULL, "connection" varchar(128) NULL);
CREATE TABLE IF NOT EXISTS "periodo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fecha_inicial" date NULL, "fecha_final" date NULL, "condominio_id" integer NOT NULL REFERENCES "condominio" ("id") DEFERRABLE INITIALLY DEFERRED, "saldo" decimal NULL);
CREATE TABLE IF NOT EXISTS "sadi_acumulado_mes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "condominio" varchar(45) NULL, "cuenta_banco" varchar(20) NULL, "mes" varchar(7) NULL, "fecha_inicial" date NULL, "fecha_final" date NULL, "depositos" decimal NULL, "retiros" decimal NULL, "saldo" decimal NULL);
CREATE TABLE IF NOT EXISTS "periodo_procesos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fecha_inicial" date NULL, "fecha_final" date NULL, "condominio_id" integer NOT NULL REFERENCES "condominio" ("id") DEFERRABLE INITIALLY DEFERRED, "saldo_inicial" decimal NULL);
CREATE TABLE IF NOT EXISTS "sadi_cuenta_banco" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cuenta" varchar(20) NOT NULL, "clabe" varchar(18) NOT NULL, "apoderado" varchar(60) NOT NULL, "fecha_saldo" date NULL, "situacion" integer NULL, "tipo_cuenta" varchar(20) NOT NULL, "banco_id" integer NOT NULL REFERENCES "banco" ("id") DEFERRABLE INITIALLY DEFERRED, "condominio_id" integer NOT NULL REFERENCES "condominio" ("id") DEFERRABLE INITIALLY DEFERRED, "saldo" decimal NULL);
CREATE TABLE IF NOT EXISTS "explorer_query" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "sql" text NOT NULL, "description" text NULL, "created_at" datetime NOT NULL, "last_run_date" datetime NOT NULL, "created_by_user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "snapshot" bool NOT NULL, "connection" varchar(128) NULL);
CREATE TABLE IF NOT EXISTS "sadi_cuotas" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "descripcion" varchar(30) NULL, "mes_inicial" date NULL, "mes_final" date NULL, "monto" decimal NULL, "cuenta_contable_id" integer NOT NULL REFERENCES "cuenta_contable" ("id") DEFERRABLE INITIALLY DEFERRED, "fecha_vencimiento" date NULL);
CREATE TABLE IF NOT EXISTS "sadi_condomino" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "depto" varchar(15) NULL, "propietario" varchar(60) NULL, "poseedor" varchar(60) NULL, "ubicacion" varchar(20) NULL, "email" varchar(25) NULL, "telefono" varchar(30) NULL, "fecha_escrituracion" date NULL, "referencia" decimal NULL, "condominio_id" integer NOT NULL REFERENCES "condominio" ("id") DEFERRABLE INITIALLY DEFERRED, "adeudo_inicial" decimal NULL, "fecha_corte_saldo" date NULL, "cargos" decimal NULL, "saldo" decimal NULL, "pagos" decimal NULL);
CREATE TABLE IF NOT EXISTS "sadi_cuotas_condomino" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cuotascondominio_id" integer NOT NULL REFERENCES "sadi_cuotas" ("id") DEFERRABLE INITIALLY DEFERRED, "condomino_id" integer NOT NULL REFERENCES "sadi_condomino" ("id") DEFERRABLE INITIALLY DEFERRED);
